import logo from './logo.svg';
import './App.css';
import {useState} from "react";

function App() {


      const [usernames, setUserNames] = useState(["Johannes", "Torben", "Benny"]);
      const [textField, setTextField] = useState("")
      let greetings = usernames.map(name => {
          return(<h1>Hello, {name}</h1>)
      })

    const handleChange = (event) => {
          setTextField(event.target.value)
    }

    const handleSubmit = () => {
        setUserNames(prevState => {
            prevState.push(textField)
        })
    }


    return (
    <div>
        {greetings}
        <input onChange={handleChange} type="text" id="newInput"/>
        <button onClick={handleSubmit}>Submit name</button>
    </div>
  );
}

export default App;
